	//"foo":  "bar", // user:foo password:bar
	//"manu": "123", // user:manu password:123
	//}))

	// authorized.POST("admin", func(c *gin.Context) {
	// 	user := c.MustGet(gin.AuthUserKey).(string)

	// 	// Parse JSON
